INSERT INTO `videos` VALUES (3, 'BV1NfDHY6ED8', '【开源】百元价格就能实现学习ROS和SLAM导航的口袋式桌面机器人！', 'http://i0.hdslb.com/bfs/archive/cf48fc88bd782f066c174fa17e83f2e53c97b975.jpg', '21883', '23', '727', '337', '1931', '193', '13', '1920×1080', 'http://10.3.36.10:7894/BV1NfDHY6ED8.mp4', '1730717753', '113424314926888', '极客DIY', 'UNI-WR2是面向ROS和SLAM导航学习场景开发的桌面级的口袋式机器人。\n比手还小，尺寸：12.9cm*9.3cm*9.8cm\n比一瓶500ml的矿泉水还轻，重量：550g\n比世界上最快的蜗牛还快，最大稳定速度：0.16m/s\n三种最常用的建图导航方式:Catgrapher、Hector、Gampping\n可在桌面运行，最小导航空间：60cm*60cm\n开源所有资料：外壳提供3D打印文件，驱动开源PCB文件，代码开源源文件', '86', '有你同创智能机器人', 'https://i0.hdslb.com/bfs/face/216759dccdd5a5f189141a980b1484190e032d2f.jpg', '217', '26613973484');
