INSERT INTO `videos` VALUES (19, 'BV1tPSnYvEsn', '豪华福建闽南宴迎接妈妈终于来芬兰啦！机场被困见面哭成泪人！姜母鸭炸醋肉醉排骨暴风吸入全家抢起来！', 'http://i2.hdslb.com/bfs/archive/573e15d345eac60c6ccb099759533167b5f7d692.jpg', '1036031', '15833', '68146', '46494', '6896', '591', '372', '1920×1080', 'http://10.3.36.10:7894/BV1tPSnYvEsn.mp4', '1730367216', '113401095329979', '美食记录', '辗转24小时妈妈终于抵达芬兰啦！这一路简直太不容易了！\n在机场被困见面我和我妈抱头痛哭，到底发生了什么？！喜迎妈妈来芬兰，豪华福建闽南宴端上桌惊艳全家！四川妈妈都说是从来没吃过的味道太新奇，姜母鸭蚵仔煎全家不停夸夸夸！炸醋肉醉排骨连挑食小侄子都爱到不行，闽南咸饭碳水爆炸全家点赞！贵州酸汤火锅被妈妈惊呼找到了最爱的味道，芬兰女婿连夜出发钓鱼就为了让丈母娘尝到芬兰野味？！这期内容超丰富，剪视频的时候我也哭哭，哈哈哈哈哈，又有笑又有泪的一期，希望大家会喜欢！爱你们！\n\n*本视频含合作【KalaVita】谢谢大家的支持，我们才有合作的机会！', '1522', '雨琪在芬兰', 'https://i2.hdslb.com/bfs/face/59f832f5fdb0a01391339ce842e4dae00c2f504a.jpg', '1335', '26555451489');
